import React from 'react';

const Navbar = () => {
	return (
		<nav className="navbar bg-light">
			<div>
				<h2>
					<i class="fa-solid fa-pen-nib"></i> Stories
				</h2>
				<ul>
					<li></li>
					<a href="/stories">Username</a>
				</ul>
			</div>
		</nav>
	);
};

export default Navbar;
